import "./App.css";

function App() {
  const person = {
    name: ["Justin", "Nick", "Nancy", "Tony", "Atlas"],
  };

  return (
    <div className="App">
      <h1>Hello World!</h1>
      {person.map((peep) => {
        return (
          <ul>
            <li>{peep.name}</li>
          </ul>
        );
      })}
    </div>
  );
}

export default App;
